import React from 'react'
import {useDispatch} from 'react-redux'
import { login,logout } from '../features/User';

const Login = () => {
    const dispatch=useDispatch();
    const handleLogin = () => {
        const user = {
          name: 'John Doe',
          age: 25,
          Email: 'john.doe@example.com',
        };

        // Dispatch the login action with the payload (user object)
        dispatch(login(user));
      };

return (
    <div>
        <button onClick={() =>{
            dispatch(login({name:"vinoth",age:20,Email:"vinoth@gmail.com"}))}}> Login </button>
        <button onClick={()=>{dispatch(logout())}}> Logout </button>
    </div>
)
}
export default Login
